import { useState } from "react";
import ServicesSection from "../components/services-section/services-section.component";

import Clients from "../components/clients/clients.component";
import VirtualAssistant from "../components/virtual-assistant/virtual-assistant";
import Footer from "../components/footer/footer.component";
import HeroSection from "../components/hero-section/hero-section.component";
import { useSnackbar } from 'react-simple-snackbar'

const Homepage = () => {
    const [openSnackbar, closeSnackbar] = useSnackbar()
    const [show, close] = useState(true)

    const SnackBar = () => {
        openSnackbar('This is the content of the Snackbar.')
    }
    return (
        <div>
            <HeroSection/>
            <ServicesSection/>
            <VirtualAssistant/>
            <Clients/>
            <Footer/>
            
            {
                
                SnackBar
                
            }
            
        </div>
    )
}

export default Homepage;
